import React from "react";
const AboutMe = () => {
    
    return (
        <div>
            <h1>About Me</h1>
            <p> I am a keen, hard working, 
                reliable and excellent time keeper. I am a bright and receptive person, able to communicate well with people 
                at all levels. I am good at working using my own initiative and I am flexible in my approach to work duties. 
                I have a good sense of humour and a pleasant approach.</p>
        </div>

    )
} 
export default AboutMe;
